// src/components/Duckling.js
import React, { forwardRef } from 'react';
import ducklingImage from '../assets/images/duckling.png';
import './Duckling.css';

const Duckling = forwardRef(({ style }, ref) => {
  return (
    <div className="duckling" style={style} ref={ref}>
      <img src={ducklingImage} alt="Duckling" />
    </div>
  );
});

export default Duckling;
